import './App.css';
import Navbar from 'react-bootstrap/Navbar'
function App() {
  return (
    <div className="App">
      <Navbar bg="dark">
        <Navbar.Brand href="#home">
          <img
            src="/logo.svg"
            width="30"
            height="30"
            className="d-inline-block align-top"
            alt="React Bootstrap logo"
          />
        </Navbar.Brand>
      </Navbar>
    </div>
  );
}

export default App;
